import React, { useEffect } from "react";

import './App.css';

function App() {
  useEffect(() => { 
    fetch("http://localhost:3000/cats")
    .then(r=>r.json())
    .then(cats => this.setState({cats: cats}))
  }, [])


  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
